import { Component } from 'react';
import Carousel from 'react-bootstrap/Carousel';
import carouselImg from '../img/carousel.png';
import carousellImg from '../img/carousel.png';
import syle from '../'


export default class CarouselBox extends Component {
    render() {
        return (
            <div className={classes.my__carousel_main}>
                <Carousel>
                    <Carousel.Item>
                        <img  className="" src={ carouselImg } />
                    </Carousel.Item>

                    <Carousel.Item interval={500}>
                    <img  className="" src={ carousellImg } />
                </Carousel.Item>


                </Carousel>

            </div>
        )
    }
}
